import React from 'react'
import Card from './components/Card';
import Header from './components/Header'
import Drawer from './components/Drawer';


const arr = [
  {name: 'Мужские Кроссовки Nike Blazer Mid Suede', price: 12999, imageURL: './img/image-1.png'},
  {name: 'Мужские Кроссовки Nike Air Max 270', price: 8499, imageURL: './img/image-2.png'},
  {name: 'Мужские Кроссовки Nike Blazer Mid Suede', price: 8499, imageURL: './img/image-2.png'},
  {name: 'Кроссовки Puma X Aka Boku Future Rider', price: 8499, imageURL: './img/image-2.png'},
]

function App() {
  return (
    <div classNameName="App">
      <div className="wrapper">
        <Drawer/>
        <Header/>
        <div className="section">
          <div className="section-top">
              <div className="title">Все кроссовки</div>
              <div className="section-top__search">
                <input type="text"/>
              </div>
          </div>
          <div className="section-bottom">
              <div className="section-bottom__row">
                {arr.map((obj, i) => (
                  <Card name={obj.name} price={obj.price} image={obj.imageURL} keywords={i++}/>
                ))}
              </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
